package JavaPracticePrograms;

public class ExplicitTypeCastingDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	    double  d = 166.6;
		long l = (long)d;
		int i = (int)l;
        System.out.println(d);
        System.out.println(l);
        System.out.println(i);
	}

}
